namespace crocodicstudio\crudbooster\types\custom;

use crocodicstudio\crudbooster\models\ColumnModel;

class CustomModel extends ColumnModel
{
    private $html;

    /**
     * @return mixed
     */
    public function getHtml()
    {
        return $this->html;
    }

    /**
     * @param mixed $html
     */
    public function setHtml($html)
    {
        $this->html = $html;
    }



}